import React from "react";
import { Box, Typography, Button, Grid, Card, CardContent } from "@mui/material";
import { PlayCircleOutline, Settings, Person, Code, Security, TrendingUp, Cloud } from "@mui/icons-material";
import { motion } from "framer-motion";
import { useNavigate } from "react-router-dom";

const fadeIn = {
  hidden: { opacity: 0, y: 50 },
  visible: { opacity: 1, y: 0, transition: { duration: 1, ease: "easeOut" } }
};

const cardVariants = {
  hidden: { opacity: 0, scale: 0.8 },
  visible: { opacity: 1, scale: 1, transition: { duration: 0.6 } }
};

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <Box
      sx={{
        minHeight: "100vh",
        bgcolor: "#FFFFFF",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        p: 4,
        textAlign: "center",
        color: "#121212",
      }}
    >
      {/* Hero Section */}
      <motion.div initial="hidden" animate="visible" variants={fadeIn}>
        <Typography variant="h3" fontWeight="bold" gutterBottom sx={{ color: "#1E1E1E" }}>
          Transform Your Business with CMS
        </Typography>
        <Typography variant="h5" sx={{ maxWidth: 700, mx: "auto", opacity: 0.9, color: "#2D2D2D" }}>
          A powerful client management system that streamlines workflows and boosts productivity.
        </Typography>
        <Typography variant="body1" sx={{ mt: 1, maxWidth: 600, mx: "auto", opacity: 0.8, color: "#4A4A4A" }}>
          Our intelligent dashboard provides real-time analytics, secure data handling, and seamless integration with your favorite tools.
        </Typography>

        {/* CTA Button */}
        <motion.div whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.95 }}>
          <Button
            variant="contained"
            sx={{
              mt: 4,
              px: 5,
              py: 1.5,
              fontSize: "1.2rem",
              bgcolor: "#1976D2",
              color: "#fff",
              borderRadius: 2,
              "&:hover": { bgcolor: "#1565C0" }
            }}
            onClick={() => navigate("/client-login")}
          >
            Get Started
          </Button>
        </motion.div>
      </motion.div>

      {/* Features Section */}
      <Grid container spacing={4} justifyContent="center" sx={{ mt: 6 }}>
        {[
          { icon: <PlayCircleOutline fontSize="large" />, text: "Quick Setup", desc: "Launch your CMS in minutes with an intuitive setup process." },
          { icon: <Settings fontSize="large" />, text: "Automation", desc: "Eliminate manual tasks with AI-powered automation tools." },
          { icon: <Person fontSize="large" />, text: "User Management", desc: "Easily manage clients, teams, and permissions." },
          { icon: <Code fontSize="large" />, text: "Developer API", desc: "Integrate your existing tools using our robust API." },
          { icon: <Security fontSize="large" />, text: "Data Security", desc: "Industry-standard encryption keeps your data secure." },
          { icon: <TrendingUp fontSize="large" />, text: "Analytics & Insights", desc: "Make data-driven decisions with real-time reports." },
          { icon: <Cloud fontSize="large" />, text: "Cloud Storage", desc: "Access your data anytime, anywhere with cloud-based storage." }
        ].map((feature, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <motion.div initial="hidden" animate="visible" variants={cardVariants}>
              <Card sx={{ p: 3, textAlign: "center", boxShadow: 4, bgcolor: "#F9F9F9", color: "#121212", borderRadius: 3 }}>
                {feature.icon}
                <CardContent>
                  <Typography variant="h6" fontWeight="bold">{feature.text}</Typography>
                  <Typography variant="body2" sx={{ opacity: 0.7 }}>{feature.desc}</Typography>
                </CardContent>
              </Card>
            </motion.div>
          </Grid>
        ))}
      </Grid>

      {/* Footer */}
      <Box sx={{ mt: 6, display: "flex", gap: 2, opacity: 0.8 }}>
        <Typography variant="body2" sx={{ color: "#4A4A4A" }}>
          Â© 2025 CMS. All rights reserved.
        </Typography>
      </Box>
    </Box>
  );
};

export default HomePage;
